import React from 'react';
import '../../styling/Task.css';

function Task(props) {
    return (
        <div className="Task">
            <div key={props.task.id} className="TaskTitle">
                {props.task.title}
            </div>
            <div key={props.task.id}  className="Specific">
                Specific: {props.task.specific}
            </div>
            <div key={props.task.id} className="Measurable">
                Measurable: {props.task.measurable}
            </div>
            <div key={props.task.id} className="Achievable">
                Achievable: {props.task.achievable}
            </div>
            <div key={props.task.id} className="Relevant">
                Relevant: {props.task.relevant}
            </div>
            <div key={props.task.id} className="Status">
                Status: {props.task.status}
            </div>
        </div>
    );
}

export default Task;
